pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract Erc20Custom is ERC20, Ownable{
    constructor(uint256 initialSupply, 
                string memory name,
                string memory symbol
                ) ERC20(name, symbol)
    {
         _mint(address(this), initialSupply * 10**18);
    }

    event Faucet(address to, uint256 amount);
    event Whitelist(address whitelistAddress);
    event WhitelistRemovedAddress(address whitelistAddress);
    mapping(address=>uint256) private faucetAddress;
    mapping(address=>bool) private whitelistAddress;
    uint256 private amountFaucet = 1000*10e18;
    uint256 private amountFaucetForWhitelistAddress = 10000*10e18;

    function _faucet(address _to) private{
        require(block.timestamp > faucetAddress[_to], "FAUCET_ERROR:MUST_GO_1_HOUR");
    }

    function faucet() external{
        if(whitelistAddress[msg.sender] == true || owner() == msg.sender){
            _mint(msg.sender, amountFaucetForWhitelistAddress);
            emit Faucet(msg.sender, amountFaucetForWhitelistAddress);
            return;
        }
        _faucet(msg.sender);
        _mint(msg.sender, amountFaucet);
        faucetAddress[msg.sender] = block.timestamp + 1 hours;
        emit Faucet(msg.sender, amountFaucet);
    }

    function getTimeToFaucet() view external returns(uint256){
        return faucetAddress[msg.sender] < block.timestamp ? 0 : faucetAddress[msg.sender] - block.timestamp;
    }

    function setAddrToWhitelist(address _whitelistAddress) onlyOwner() external {
        require(getStatusAddrFromWhitelist(_whitelistAddress) != true);
        whitelistAddress[_whitelistAddress] = true;
        emit Whitelist(_whitelistAddress);
    }

    function deleteAddrFromWhitelist(address _whitelistAddress) onlyOwner() external {
        require(getStatusAddrFromWhitelist(_whitelistAddress) == true);
        delete whitelistAddress[_whitelistAddress];
        emit WhitelistRemovedAddress(_whitelistAddress);
    }

    function getStatusAddrFromWhitelist(address _whitelistAddress) view public returns(bool){
        return whitelistAddress[_whitelistAddress];
    }

}
